import { Routes, Route } from 'react-router-dom';
import Topnav from './common/Topnav';
import Main from './routes/Main';

function App() {
    return (
        <div className='App'>
            <Topnav />

            <Routes>
                <div className='container'>
                    <Route path='/' element={<Main />} />
                </div>
            </Routes>
        </div>
    );
}

export default App;
